import React from 'react'

let dragNDrop = e => {
  console.log(e.target);

}

const TaskItem = ({task , index}) =>{

  return(
  <li onClick={dragNDrop} id={task.id}>{index+1} {task.title} {task.completed.toLocaleString()}</li>
    )
}

export default TaskItem
